@Flangelus Well, empirically the exponential spread of veganism has a ceiling, because most people are not vegans, as they would be by now if the "spread" worked akin to an unchecked infectious disease. Most likely, I suspect, there are some people who are suggestible to veganism, they need encouragement from others to make that jump but ultimately they were always predisposed to that sort of decision. The sort of word-of-mouth approach you suggest may reach say, ten to twenty percent of westerners, but I'm not sure that's really enough. If you really want a meat-free world, it would have to come from the top down, not the bottom up.

(I also note that you seem to have lapsed from making an environmental case at this point to being solely one over animal rights, which confirms my thoughts that you would have gone vegan anyway and the environmental factors are simply a side issue. Personally, I'm not too fussed over animal rights, it's just never been a high priority for me, humans are simply doing a more sophisticated version of what every apex predator before them did. This is obviously something we aren't ever going to agree on, because it is a fundamental difference in values.)

In terms of the teaching analogy, yes, I understand it is flawed. I'll give you that one. How about a better analogy - gun control in the US. Yes, gun owners could be more responsible. They could even decide to get rid of their guns voluntarily. But they just aren't going to. Whenever there is a mass shooting in the US, people blame the easy availability of lethal weapons - and they are completely right to look at government inaction rather than the individual perpetrator. I believe meat consumption (to the extent that it is polluting in a way that affects humans) is in a similar category to gun ownership.

