The human population exploding is actually a sign that the human race is able to survive exceptionally well (due to fossil fuel use). There are many secondary problems that come from having an exploding population, one which submits to a central authority that cannot cope with the increased bureaucratic demands. However, the population increase is not the problem itself, it is actually a good sign.

Chlorophyll production measured by satellites is actually increasing due to CO2. However, plant life and trees are dying in certain locales due to acidic rain caused by an output of SO2 and many other toxic wastes output by industry. Waters are polluted by chemical run-off and this affects our food chain directly. This is what needs to be addressed, not the increase in CO2. This is yet another fallacy that people buy into when thinking that the planet is dying - they focus on the CO2 and forget about the rest of the problems, hoping that somehow industry will be shut down by Carbon taxation and all the rest of the problems will cease. It doesn't happen like that. We need energy and resources to maintain our population, so attacking CO2 output will not solve any of the toxic waste issues we have.

