@The Other Cat You are quite right that people are getting richer and in that sense the world has been continuously improving for a long time. But if you measure ecosystem change and greenhouse gases, and model the results of those changes, it's very obvious that the planet is much degraded in these terms, and that continuing to raise GHGs will produce increasingly serious effects. I guess you are a 'lukewarmer': you agree the Earth is warming but don't agree with the modelling showing that the effects of that will be pretty bad, potentially catastrophic, and eventually irreversible. The idea that just as many scientists agree with you as with the mainstream opinion that it is vital to stay below about 2C is frankly laughable at this point. The IPCC represents median, conservative, scientific opinion. There is a significant risk that things will turn out worse than that.

The examples you give of people getting things wrong is not usually scientists, or is misrepresented as a prediction when in fact it was a worst-case possibility. Obviously there have been a few incorrect predictions by scientists, but they remain unusual and do not in any way undermine the mainstream. The 5-20 foot sea level rise is _by 2100_ not now, for example, unless you can find the paper or quote predicting that by 2020? I expect a similar caveat goes for your 'midwest desert' prediction example, but I don't know about that.

You seem smart - I suggest you read the latest IPCC special report and see if you can see anything actually wrong or significantly disputed in there.

@The Other Cat So what's your solution then?  There is a not-so-little book named "Drawdown: The Most Comprehensive Plan Ever Proposed to Reverse Global Warming" and I'd say the plethora of science used to make the book is right on, and yet the suggestions are just what the alarmists are pretty much saying, except leave out the government mandate of them.  So that book doesn't really mention how we might push governments to act, and you fill in that critical gap with the goodwill of people to do the right thing, right?  Well, then why over the last 30 years have they not done the right thing?  And what makes you think they ever will until millions die per day?  

Our entire civilization is addicted to fossil fuels, which are eventually going to wipe us out if we don't stop.  Our addiction is no different than any other hardcore drug user's addiction, so like any druggie, we make up excuses how we can keep doing our drug of choice but manage it.  Then we make up reasons why we will one day stop but not quite right now.  I'm tired of these lies, aren't you?  

To me, it sounds like you call any drastic action the product of an alarmist view.  Well, what if the problem IS alarming as any problem on the planet, and thus, the solutions will be wide-ranging and more expensive in the short-term than burning the rest of the fossil fuels?  I guess you don't believe that.  I do after studying this problem for years.

